const moment = require('moment');

function isDeathRallyPreparationTime() {
    const currentTime = moment();
    const startTime = moment().set('hour', 18).set('minute', 0).set('second', 0);
    const endTime = moment().set('hour', 19).set('minute', 0).set('second', 0);

    return currentTime.isBetween(startTime, endTime);
}

module.exports = isDeathRallyPreparationTime;
